result:
  query($id: ID!) {
    project(id: $id) {
      id
      title

      countries

      humanTime : created(format:"DD MMMM YYYY")
      datetime : created(format:"ddd MMM DD YYYY hh:mm:ss zZ")
      image(width:150, height:150)
      image_caption
      logo
      cities
      timeToRead
      path
      timeToRead
      linkedin
      content
      tags {
        id
        title
        path
      }    
      members {
        id
        name
        image(width:64, height:64, fit:inside)
        path
      }
      websites
      private

      rank
      excerpt

      belongsTo {
        totalCount
        pageInfo {
          totalPages
          currentPage
        }
        edges {
          node {
            ... on Person {
              id
              name
              image(width:64, height:64, fit:inside)
              path
              projects{
                  id
                  title
                  path
                  logo
                  image
              }
            }
          }
        }
      }
    }  

    tags: allProjectTag (filter: { title: {in: ["farming"]}}) {
     edges{
      node{
        id
        title
        path
      }
  }
  }


}
